  return (
    <div className="App">
      <h1>Aaaaaooooonaaaaaa!!!!</h1>
      <h2>{compteur}</h2>
        <button onClick={handleClick}>Incrémente</button>
        <button onClick={handleClick}>Décrémente</button>
    </div>
  );
}
